import Menu from './Menu';
import './Header.css';
import CoinLogo from './CoinLogo';

function Header() {
  return (
    <div className="Header">
        <CoinLogo width="50" height="50" />
        <Menu width="50" height="50" />
    </div>
  );
}

export default Header;
